/* VCD dumping routines */

unsigned int MOD_mkSoC_Top::dump_VCD_defs(unsigned int levels)
{
  vcd_write_scope_start(sim_hdl, inst_name);
  vcd_num = vcd_reserve_ids(sim_hdl, 4u);
  unsigned int num = vcd_num;
  for (unsigned int clk = 0u; clk < bk_num_clocks(sim_hdl); ++clk)
    vcd_add_clock_def(sim_hdl, this, bk_clock_name(sim_hdl, clk), bk_clock_vcd_num(sim_hdl, clk));
  vcd_write_def(sim_hdl, bk_clock_vcd_num(sim_hdl, __clk_handle_0), "CLK", 1u);
  vcd_write_def(sim_hdl, num++, "RST_N", 1u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "to_raw_mem_request_get", 353u);
  vcd_set_clock(sim_hdl, num, __clk_handle_0);
  vcd_write_def(sim_hdl, num++, "to_raw_mem_response_put", 256u);
  num = INST_rg_state.dump_VCD_defs(num);
  if (levels != 1u)
  {
    unsigned int l = levels == 0u ? 0u : levels - 1u;
    num = INST_boot_rom.dump_VCD_defs(l);
    num = INST_brvf_core.dump_VCD_defs(l);
    num = INST_fabric.dump_VCD_defs(l);
    num = INST_mem0_controller.dump_VCD_defs(l);
    num = INST_soc_map.dump_VCD_defs(l);
    num = INST_timer0.dump_VCD_defs(l);
    num = INST_uart0.dump_VCD_defs(l);
  }
  vcd_write_scope_end(sim_hdl);
  return num;
}

void MOD_mkSoC_Top::dump_VCD(tVCDDumpType dt, unsigned int levels, MOD_mkSoC_Top &backing)
{
  vcd_defs(dt, backing);
  vcd_prims(dt, backing);
  if (levels != 1u)
    vcd_submodules(dt, levels - 1u, backing);
}

void MOD_mkSoC_Top::vcd_defs(tVCDDumpType dt, MOD_mkSoC_Top &backing)
{
  unsigned int num = vcd_num;
  if (dt == VCD_DUMP_XS)
  {
    vcd_write_x(sim_hdl, num++, 1u);
    vcd_write_x(sim_hdl, num++, 353u);
    vcd_write_x(sim_hdl, num++, 256u);
  }
  else
    if (dt == VCD_DUMP_CHANGES)
    {
      if ((backing.PORT_RST_N) != PORT_RST_N)
      {
	vcd_write_val(sim_hdl, num, PORT_RST_N, 1u);
	backing.PORT_RST_N = PORT_RST_N;
      }
      ++num;
      if ((backing.PORT_to_raw_mem_request_get) != PORT_to_raw_mem_request_get)
      {
	vcd_write_val(sim_hdl, num, PORT_to_raw_mem_request_get, 353u);
	backing.PORT_to_raw_mem_request_get = PORT_to_raw_mem_request_get;
      }
      ++num;
      if ((backing.PORT_to_raw_mem_response_put) != PORT_to_raw_mem_response_put)
      {
	vcd_write_val(sim_hdl, num, PORT_to_raw_mem_response_put, 256u);
	backing.PORT_to_raw_mem_response_put = PORT_to_raw_mem_response_put;
      }
      ++num;
    }
    else
    {
      vcd_write_val(sim_hdl, num++, PORT_RST_N, 1u);
      backing.PORT_RST_N = PORT_RST_N;
      vcd_write_val(sim_hdl, num++, PORT_to_raw_mem_request_get, 353u);
      backing.PORT_to_raw_mem_request_get = PORT_to_raw_mem_request_get;
      vcd_write_val(sim_hdl, num++, PORT_to_raw_mem_response_put, 256u);
      backing.PORT_to_raw_mem_response_put = PORT_to_raw_mem_response_put;
    }
}

void MOD_mkSoC_Top::vcd_prims(tVCDDumpType dt, MOD_mkSoC_Top &backing)
{
  INST_rg_state.dump_VCD(dt, backing.INST_rg_state);
}

void MOD_mkSoC_Top::vcd_submodules(tVCDDumpType dt, unsigned int levels, MOD_mkSoC_Top &backing)
{
  INST_boot_rom.dump_VCD(dt, levels, backing.INST_boot_rom);
  INST_brvf_core.dump_VCD(dt, levels, backing.INST_brvf_core);
  INST_fabric.dump_VCD(dt, levels, backing.INST_fabric);
  INST_mem0_controller.dump_VCD(dt, levels, backing.INST_mem0_controller);
  INST_soc_map.dump_VCD(dt, levels, backing.INST_soc_map);
  INST_timer0.dump_VCD(dt, levels, backing.INST_timer0);
  INST_uart0.dump_VCD(dt, levels, backing.INST_uart0);
}
